function choose(choices) {
  var index = Math.floor(Math.random() * choices.length);
  return choices[index];
}

function generate_text(svenwords, num_words){
    var current_word = '$';
    var statement = '';
	var word_list;
	var new_word;
    while (num_words > 0){
        word_list = svenwords[current_word];
        new_word = choose(word_list);
        statement = statement.concat(new_word.concat(' ')); 
        if (new_word.charAt(new_word.length-1) == '.' || new_word.charAt(new_word.length-1) == '?' || new_word.charAt(new_word.length-1) == '!'){
			current_word = '$';
		}
        else{
            current_word = new_word;
		}
        num_words -= 1;
	}
    return statement;
}


 
function svenerate(){
	var num_words = document.getElementById("inputArea").value;
	document.getElementById("outputArea").innerHTML = "<p>"+generate_text(svenwords,num_words)+"</p>";
}
